import React from "react";
import { CartContext } from "../context/Context";
import SubItems from "./SubItems";

const Items = () => {
  const { products } = useContext(CartContext);
  return (
    <>
      <h1>items</h1>
      {products.map((val) => {
        return <SubItems key={val.id} prod={val} />;
      })}
    </>
  );
};

export default Items;
